    false,nt"url": null,nt"notes": "This annual narrative report for Audubon
    National Wildlife Refuge outlines Refuge accomplishments during the 1989 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    The report includes a planning section which discusses public participation and
    research and investigations. Refuge administration is outlined; information about
    personnel, funding, safety, and technical assistance is given. Habitat management
    is also covered; subjects include wetlands, croplands, grasslands, grazing, haying,
    fire management, and pest control. The wildlife section of the report discusses
    endangered and threatened species, migratory birds, game mammals, animal control,
    and waterfowl marking and banding. The public uses of the Refuge described in this
    report include information and interpretation, recreational uses, and law enforcement.
    The equipment and facilities section of the report provides information about major
    maintenance, equipment replacement, communication systems, and energy conservation.
    Photographs and brief narrative reports for Lake Nettie, McLean, Hiddenwood, Lake
    Otis, Sheyenne Lake, Lost Lake, Camp-Strawberry Lake, Hiddenwood, Lake Otis, and
    Lost Lake National Wildlife Refuges are attached.",nt"license_title": "License
